    "environmental-contaminants-in-american-and-arctic-peregrine-falcon-eggs-in-alaska-1979-95",nt"isopen":
    false,nt"url": null,nt"notes": "Arctic and American peregrine falcons (Falco
    peregrinus tundrius and F. p. anatum) were listed as endangered under the Endangered
    Species Preservation Act (1969) in 1970, and later, in 1973, under the Endangered
    Species Act. At the time of listing, some local populations of American peregrine
    falcons in the eastern United States had disappeared, and populations in western
    and northern North America had been reduced by 80 percent or more. Organochlorine
    pesticides such as DDT and its breakdown product DDE were identified as the cause
    of the decline. The peregrines accumulated these chemicals in their tissues by feeding
    on birds that had eaten DDT-contaminated insects or seeds. These chemicals prevented
    normal calcium deposition during eggshell formation, and caused females to lay thin-shelled
    eggs that often broke before hatching. Since 1979, the U.S. Fish and Wildlife Service
    has monitored environmental contaminants in American peregrine falcon and arctic
    peregrine falcon eggs in interior and arctic Alaska. Monitoring goals were collection
    and analysis of a minimum of 10 eggs from each subspecies every five years. The
    results of the 1984 program were reported by Ambrose et al. (1988a); this paper
    reports on 1988-95 analyses and compares data across the entire time span (eggs
    from 89 F. p. anatum and 68 F. p. tundrius nests from interior and northern Alaska
    collected between 1979 and 1995).",nt"license_title": "License Not Specified",nt"extras":
